INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (3, N'Chromoly steel.', N'301eed3a-1a82-4855-99cb-2afe8290d641', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (4, N'Aluminum alloy cups; large diameter spindle.', N'dfeba528-da11-4650-9d86-cafda7294eb0', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (5, N'Aluminum alloy cups and a hollow axle.', N'f7178da7-1a7e-4997-8470-06737181305e', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (8, N'Suitable for any type of riding, on or off-road. Fits any budget. Smooth-shifting with a comfortable ride.', N'8e6746e5-ad97-46e2-bd24-fcea075c3b52', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (64, N'This bike delivers a high-level of performance on a budget. It is responsive and maneuverable, and offers peace-of-mind when you decide to go off-road.', N'7b1c4e90-85e2-4792-b47b-e0c424e2ec94', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (88, N'For true trail addicts.  An extremely durable bike that will go anywhere and keep you in control on challenging terrain - without breaking your budget.', N'4c1ad253-357e-4a98-b02e-02180aa406f6', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (128, N'Serious back-country riding. Perfect for all levels of competition. Uses the same HL Frame as the Mountain-100.', N'130709e6-8512-49b9-9f62-1f5c99152056', CAST(N'2008-03-11T10:32:17.973' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (168, N'Top-of-the-line competition mountain bike. Performance-enhancing options include the innovative HL Frame, super-smooth front suspension, and traction for all terrain.', N'db979da6-4cc8-4171-9ecf-65003ff8178a', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (170, N'Suitable for any type of off-road trip. Fits any budget.', N'ea772412-6369-4416-9cc9-c1a5d1ff9c52', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (209, N'Entry level adult bike; offers a comfortable ride cross-country or down the block. Quick-release hubs and rims.', N'f5ff5ffd-cb7c-4ad6-bbc9-4d250bb6e98d', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (249, N'Value-priced bike with many features of our top-of-the-line models. Has the same light, stiff frame, and the quick acceleration we''re famous for.', N'4291f144-7693-4460-8b0b-1373e0433021', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (320, N'Same technology as all of our Road series bikes, but the frame is sized for a woman.  Perfect all-around bike for road or racing.', N'e130ded9-d0ec-4656-bf4d-1a3a46491891', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (321, N'Same technology as all of our Road series bikes.  Perfect all-around bike for road or racing.', N'c7b429da-dc51-47db-a18e-5891e76ccc16', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (337, N'A true multi-sport bike that offers streamlined riding and a revolutionary design. Aerodynamic design lets you ride with the pros, and the gearing will conquer hilly roads.', N'db560f0b-e70b-42a7-a1f5-3b7e42d3679d', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (375, N'Cross-train, race, or just socialize on a sleek, aerodynamic bike.  Advanced seat technology provides comfort all day.', N'747b2185-0320-4fe5-8e8f-27b84a40a838', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (376, N'Cross-train, race, or just socialize on a sleek, aerodynamic bike designed for a woman.  Advanced seat technology provides comfort all day.', N'f1d9955b-bc1c-4d34-be8b-cdee33e77087', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (409, N'Alluminum-alloy frame provides a light, stiff ride, whether you are racing in the velodrome or on a demanding club ride on country roads.', N'3dc76714-7572-4547-9d79-abb708950b2c', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (457, N'This bike is ridden by race winners. Developed with the Adventure Works Cycles professional race team, it has a extremely light heat-treated aluminum frame, and steering that allows precision control.', N'3ddb8dea-fc37-4e44-8c1d-0bf7c6a723e3', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (513, N'All-occasion value bike with our basic comfort and safety features. Offers wider, more stable tires for a ride around town or weekend trip.', N'741eae59-5e59-4dbc-9086-2633392c2582', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (554, N'The plush custom saddle keeps you riding all day,  and there''s plenty of space to add panniers and bike bags to the newly-redesigned carrier.  This bike has stability when fully-loaded.', N'ddc955b2-843e-49ce-8f7b-54870f6135eb', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (594, N'Travel in style and comfort. Designed for maximum comfort and safety. Wide gear range takes on all hills. High-tech aluminum alloy construction provides durability without added weight.', N'32b82c92-e545-4da0-a175-0be710b482fe', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (613, N'Superior shifting performance.', N'9c7d8618-a3c3-4c0f-8c72-2e10124e88ca', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (618, N'Super rigid spindle.', N'e15ffa7e-bde8-4de1-8e81-f197a56e0c9d', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
