INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (1487, N'Adapté à tous les usages, sur route ou tout-terrain. Pour toutes les bourses. Changement de braquet en douceur et conduite confortable.', N'5c1dab3a-4b31-4d9d-a14f-3cb61949b79b', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (1488, N'Ce vélo offre un excellent rapport qualité-prix. Vif et facile à manœuvrer, il se conduit en toute tranquillité sur les chemins et les sentiers.', N'79065ec8-2080-4120-a4ea-bfa7ea1f1f9d', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (1489, N'Pour les véritables passionnés du VTT. Un vélo extrêmement robuste qui vous permettra d''aller partout, même sur les terrains difficiles, pour un budget raisonnable.', N'93463372-82ef-4ec4-ba0f-da371a6fbef6', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (1490, N'Conduite sur terrains très accidentés. Idéal pour tous les niveaux de compétition. Utilise le même cadre HL que le Montain-100.', N'2b6fa2a7-4815-47b6-a6bc-d6aec23b85cc', CAST(N'2008-03-11T10:32:17.973' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (1491, N'VTT de compétition haut de gamme. Plusieurs options d''amélioration des performances : cadre HL, suspension avant particulièrement souple et traction adaptée à tous les terrains.', N'3d73a955-289a-47c1-bf47-596eb0cbbaa1', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (1492, N'Adapté à tous les terrains. Pour toutes les bourses.', N'2198e171-cf84-44e2-8b73-342a45e18366', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (1493, N'Vélo d''adulte d''entrée de gamme ; permet une conduite confortable en ville ou sur les chemins de campagne. Moyeux et rayons à blocage rapide.', N'7943455f-3fbe-44c0-9ac2-7ee642d3944b', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
INSERT [dbo].[ProductDescription] ([ProductDescriptionID], [Description], [rowguid], [ModifiedDate]) VALUES (1494, N'Vélo très séduisant comportant de nombreuses caractéristiques des modèles haut de gamme. Bénéficie du cadre léger et rigide, mais aussi de la ligne performante qui ont fait notre réputation.', N'485b21fe-a5b5-4df2-a2f8-3de106f08ef1', CAST(N'2007-06-01T00:00:00.000' AS DateTime))
